import React from 'react'
import {Link} from 'react-router-dom'

export default function DigitalZone() {
    return (
			<div className='container'>
				<div style={{ textAlign: "center" }}>
					<Link
						to='/digital_zone'
						style={{
							textDecoration: "none",
							margin: "auto",
							textAlign: "center",
						}}>
						<div
							className='categorybox'
							style={{
								display: "inline-block",
								// flexDirection: "column",
							}}>
							<img
								style={{
									width: "100px",
									height: "80px",
									borderRadius: "10px",
								}}
								src='https://cdn.mos.cms.futurecdn.net/vEcELHdn998wRTcCzqV5m9.jpg'
							/>
							<h4 style={{ margin: "auto" }}>Ticket</h4>
						</div>
					</Link>
				</div>

				<div style={{ textAlign: "center" }}>
					<Link
						to='/digital_zone'
						style={{
							textDecoration: "none",
							margin: "auto",
							textAlign: "center",
						}}>
						<div
							className='categorybox'
							style={{
								display: "inline-block",
								// flexDirection: "column",
							}}>
							<img
								style={{
									width: "100px",
									height: "80px",
									borderRadius: "10px",
								}}
								src='https://cdn.mos.cms.futurecdn.net/vEcELHdn998wRTcCzqV5m9.jpg'
							/>
							<h4 style={{ margin: "auto" }}>Mobile Recha</h4>
						</div>
					</Link>
				</div>
			</div>
		);
}
